ミヨシ 暮らしの重曹 600g<br>ブランド：暮らしの洗浄剤シリーズ<br>販売・製造元：ミヨシ石鹸<br><br>お掃除、お洗濯、食器洗いなど、暮らしの中でつかえる重曹(洗剤)です。<br>重曹(炭酸水素ナトリウム)は胃薬・ふくらし粉・入浴剤・歯磨等にも配合されています。<br>工夫次第で暮らしの様々な場面で用途がひろがる便利品。<br>冷蔵庫のにおい消しや浴槽掃除にもお使いいただけます。<br> <br><br><br>使用方法<br>●食器のシミ・茶渋・ポットの水垢取り等に、調理器具・シンク・浴槽等の洗浄に水を含ませたスポンジ等に重曹をつけて洗浄します。<br>●鍋などのこげ落としに鍋に水を入れ重曹をふりかけて煮ます。<br>冷えてからこすり落します。<br>(水1カップに大さじ1杯の割合)●冷蔵庫、クロゼット、下駄箱等の臭い取りにカップ2-3杯の重曹をふたのない容器に入れ、置いておきます。<br>効果は2ヶ月位。<br>使用後はお掃除用に再利用できます。<br>●お掃除用にレンジ・冷蔵庫内、ガラス等の清掃には重曹を水に溶かし、ぞうきん拭きします。<br>(水1Lに大さじ3杯の割合)●お洗濯にせっけんをお使いの場合の補助剤に重曹を加えると洗浄力がより良くなり、洗濯物の除臭効果があります。<br>(水30Lに大さじ3杯の割合) <br><br>使用上の注意<br>●食品ではありません。<br>●幼児の手の届く所に置かない。<br>●食品に使用しない。<br>●熱湯に入れるとふきこぼれるので注意する。<br>●荒れ性の方や長時間お使いになる場合は、炊事用手袋を使用する。<br>●アルミ製・銅製・漆塗りの食器や調理器具等、金線・銀線・上絵付きの食器等には使用しない。<br>●柔らかい素材の物は、傷つける事があるので目立たないところで試し、使用には傷つけないよう、強くこすらない。<br>●使用後は湿気が入らないよう、袋の中の空気を押し出し、チャックを閉じる。<br>●直射日光をさけ、高温多湿の所に保管しない。<br>(応急処置)●万一飲み込んだ場合は水を飲ませるなどの処置をする。<br>●目に入った場合は、こすらずにすぐ水でよく洗う。<br>●異常がある場合は、医師に相談する。<br> 品質表示●用途：台所用、住まいの洗浄●液性：弱アルカリ性●成分：炭酸水素ナトリウム 重曹とは重曹は、天然の無機物質である炭酸水素ナトリウムであり、研磨作用や中和作用、軟水作用、消臭・吸湿作用、発泡・膨張作用など様々な作用を持っているため、お風呂やシンクの掃除、入浴剤、飲食物など、幅広く使用されています。<br><br>日用品／キッチン用品／台所用洗剤／重曹<br>JANコード： 4537130101018<br><br>CS：16<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
