【商品説明】<br>塩素系強力液体タイプ。洗たく槽のカビや石けんカスを根こそぎ落とす。除菌・消臭効果。全自動・乾燥機能付き全自動・ドラム対応。<br>使用方法用途など：<BR>●電源を入れてから本剤全量を洗たく槽に入れる。<br>●高水位まで給水する。<br>●風呂の残り湯は使用しても良いが、入浴剤を入れたものは使用しない。<br>●機種によって使用方法が異なる場合があるので各洗たくメーカーの取り扱い説明書を参照して下さい。<br>用法用量使用量の目安：<BR>塩素系強力液体タイプ。洗たく槽のカビや石けんカスを根こそぎ落とす。除菌・消臭効果。全自動・乾燥機能付き全自動・ドラム対応。<br><br>成分：<BR>次亜塩素酸塩・界面活性剤・水酸化ナトリウム<br>使用上の注意：<BR>●用途以外に使わない。<br>●液が目に入らないように注意。<br>●必ず単独で使用。<br>●必ず換気をして使用。<br>●酸性タイプの製品や食酢、アンモニア、などと混ぜると有害なガスが発生して危険。<br>●皮膚につくと刺激がある。<br>●作業後は必ず手を洗う。<br>応急処置：<BR>●目に入った時は流水で１５分以上洗い流す。<br>●必ず直後に眼科医を受診する。そのまま放置すると失明の恐れがある。<br>●飲み込んだ時は吐かせず、すぐ口をすすぎ、牛乳か水を飲む等の処置をし医師に相談する。<br>●皮ふについた時はすぐに水で洗い流す。皮膚科医に相談する。<br>●使用中、目にしみたり、咳き込んだり、あるいわ気分が悪くなった時は、使用をやめてその場から離れ、洗眼、うがい等をする。<br>●受診時は商品を持参する。<br>●熱湯では使わない。<br>●洗濯物を入れたまま使わない、衣類や敷物に付くと脱色するので、注意。<br>●直射日光を避け、冷暗所に立てて保管する。<br><br><br>保管保存方法：<BR>●目に入った時は流水で１５分以上洗い流す。ｂｒ●必ず直後に眼科医を受診する。そのまま放置すると失明の恐れがある。ｂｒ●飲み込んだ時は吐かせず、すぐ口をすすぎ、牛乳か水を飲む等の処置をし医師に相談する。ｂｒ●皮ふについた時はすぐに水で洗い流す。皮膚科医に相談する。ｂｒ●使用中、目にしみたり、咳き込んだり、あるいわ気分が悪くなった時は、使用をやめてその場から離れ、洗眼、うがい等をする。ｂｒ●受診時は商品を持参する。ｂｒ●熱湯では使わない。ｂｒ●洗濯物を入れたまま使わない、衣類や敷物<br>問い合わせ先：<BR>〒３６６-００２２　埼玉県深谷市本田ヶ谷１２０ カネヨ石鹸株式会社　　 電話番号　０４８-５７３-７８５１<br>原産国：日本<br>ブランド：カネヨ<BR>商品サイズ：99×193×52<br>JANコード：4901329290386<BR>cs：24<BR>商品カテゴリ： お洗濯・衣類・靴ケア ＞ 洗濯槽クリーナー　(230000)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
